import React from 'react';
import styled from 'styled-components';

const Title = styled("h5")`
  font-weight: 600;
  font-size: 14px;
  line-height: 19px;
  text-align: center;
  color: #444444;
`;

const SubTitle = styled("h6")`
  font-weight: 300;
  font-size: 12px;
  line-height: 16px;
  text-align: center;
  color: #444444;
  margin-top: -10px;
`;


export {Title, SubTitle};
